/// <summary>
/// Makes the static call to a transaction service method.
/// </summary>
/// <param name = "_className">The class name.</param>
/// <param name = "_staticMethodName">The method name.</param>
/// <param name = "_params">The list of parameters.</param>
/// <param name = "_company">The company name.</param>
/// <param name = "_language">The language.</param>
/// <returns>The response <c>RetailTransactionServiceResponse</c> object.</returns>
public static RetailTransactionServiceResponse MakeStaticCall(str _className, str _staticMethodName, List _params, str _company, str _language)
{
    Counter     infologline = infolog.num();
    int         fromLine = Global::infologLine();

    container results = RetailRealTimeServiceWrapper::MakeStaticCallToWrapper(_className, _staticMethodName, _params, _company, _language);

    // Look for and log any messages observed during method invocation, as they typically indicate an error occurred
    str messages = RetailTransactionServiceUtilities::getAndClearInfologMessages(fromLine);
    if (strLen(messages) > 0)
    {
        AppLogging::EventWriteRetailTransactionServiceStaticCallError(_className, _staticMethodName, messages);
    }

    return RetailRealTimeServiceWrapper::ConvertContainerToResponse(results);
}

/// <summary>
/// Makes the call to transaction service method wrapper.
/// </summary>
/// <param name = "_className">The class name.</param>
/// <param name = "_staticMethodName"The method name.></param>
/// <param name = "_params">The list of parameters.</param>
/// <param name = "_company">The company name.</param>
/// <param name = "_language">The language.</param>
/// <returns>The response container.</returns>
private static container MakeStaticCallToWrapper(str _className, str _staticMethodName, List _params, str _company, str _language)
{
    if (strlen(_className) == 0)
    {
        throw Global::error("@Retail:RealTimeServiceClassNameEmptyError");
    }

    if (strlen(_staticMethodName) == 0)
    {
        throw Global::error("@Retail:RealTimeServiceInputMethodNameEmptyError");
    }

    if (_params == null)
    {
        // Create empty list for parameters if it's null.
        _params = new List(Types::AnyType);
    }

    if (RetailCdxFeatureControl::IsRtsSessionOptimizationDisabled())
    {
        return RetailRealTimeServiceWrapper::MakeStaticCallToWrapperLegacy(_className, _staticMethodName, _params, _company, _language);
    }
    else
    {
        return RetailRealTimeServiceWrapper::MakeStaticCallToWrapperOptimized(_className, _staticMethodName, _params, _company, _language);
    }
}

/// <summary>
/// Makes the call to transaction service method wrapper in not an optimized (legacy) way.
/// </summary>
/// <param name = "_className">The class name.</param>
/// <param name = "_staticMethodName">The method name.</param>
/// <param name = "_params">The list of parameters.</param>
/// <param name = "_company">The company name.</param>
/// <param name = "_language">The language.</param>
/// <returns>The response container.</returns>
private static container MakeStaticCallToWrapperLegacy(str _className, str _staticMethodName, List _params, str _company, str _language)
{
    RunAsPermission perm;
    UserId          runAsUser;
    SysUserInfo     userInfo;
    container       result;

    userInfo = SysUserInfo::find();
    runAsUser = userInfo.Id;
    perm = new RunAsPermission(runAsUser);
    perm.assert();

    if (_company && _language)
    {
        result = runAs(runAsUser, classNum(RetailRealTimeServiceWrapper), staticMethodStr(RetailRealTimeServiceWrapper, CallStatic), [_className, _staticMethodName, _params.pack()], _company, _language);
    }
    else if (_company)
    {
        result = runAs(runAsUser, classNum(RetailRealTimeServiceWrapper), staticMethodStr(RetailRealTimeServiceWrapper, CallStatic), [_className, _staticMethodName, _params.pack()], _company);
    }
    else
    {
        result = runAs(runAsUser, classNum(RetailRealTimeServiceWrapper), staticMethodStr(RetailRealTimeServiceWrapper, CallStatic), [_className, _staticMethodName, _params.pack()]);
    }

    CodeAccessPermission::revertAssert();

    return result;
}

/// <summary>
/// Makes the call to transaction service method wrapper in an optimized (session-conscious) way.
/// </summary>
/// <param name = "_className">The class name.</param>
/// <param name = "_staticMethodName">The method name.</param>
/// <param name = "_params">The list of parameters.</param>
/// <param name = "_company">The company name.</param>
/// <param name = "_language">The language.</param>
/// <returns>The response container.</returns>
private static container MakeStaticCallToWrapperOptimized(str _className, str _staticMethodName, List _params, str _company, str _language)
{
    RunAsPermission perm;
    container       result;

    if (_language && _language != (new xInfo().language()))
    {
        perm = new RunAsPermission(curUserId());
        perm.assert();

        try
        {
            // Use RunAs because we don't have an API to change the session language
            result = runAs(curUserId(), classNum(RetailRealTimeServiceWrapper), staticMethodStr(RetailRealTimeServiceWrapper, CallStatic), [_className, _staticMethodName, _params.pack()], _company, _language);
        }
        finally
        {
            CodeAccessPermission::revertAssert();
        }
    }
    else if (_company && _company != curext())
    {
        changecompany(_company)
        {
            result = RetailRealTimeServiceWrapper::CallStatic([_className, _staticMethodName, _params.pack()]);
        }
    }
    else
    {
        result = RetailRealTimeServiceWrapper::CallStatic([_className, _staticMethodName, _params.pack()]);
    }

    return result;
}

