/// <summary>
/// Converts parameters list to container.
/// </summary>
/// <param name = "parameters">Parameters list.</param>
/// <returns>Parameters container.</returns>
private static Array ConvertListToArray(List parameters)
{
    Array arrParams = new Array (Types::AnyType);
    ListIterator iter = new ListIterator(parameters);
    int iteratorIndex = 1;

    while (iter.more())
    {
        arrParams.value(iteratorIndex, iter.value());
        iteratorIndex++;
        iter.next();
    }

    return arrParams;
}

/// <summary>
/// Converts response container to list.
/// </summary>
/// <param name = "result">Result container.</param>
/// <returns>Result list.</returns>
private static List ConvertContainerToList(Container result)
{
    List responseObjects = new List(Types::AnyType);
    int length = conLen(result);
    for (int counter = 1; counter <= length; counter++)
    {
        responseObjects.addEnd(conPeek(result,counter));
    }

    return responseObjects;
}

/// <summary>
/// Converts container to service reponse.
/// </summary>
/// <param name = "results">Return results container.</param>
/// <returns>Transaction service response</returns>
internal static RetailTransactionServiceResponse ConvertContainerToResponse(container results)
{
    RetailTransactionServiceResponse response = new RetailTransactionServiceResponse();
    response.Success(conpeek(results, 1));
    response.Message(conpeek(results, 2));
    results = condel(results, 1, 2);
    response.Data(RetailRealTimeServiceWrapper::ConvertContainerToList(results));
    return response;
}
